CREATE TABLE IF NOT EXISTS media(
    mediaId                        SERIAL PRIMARY KEY,
    type                           BOOLEAN NOT NULL,
    name                           VARCHAR(255) NOT NULL,
    originalLanguage               VARCHAR(2),
    adult                          BOOLEAN NOT NULL,
    releaseDate                    DATE,
    overview                       TEXT NOT NULL,
    backdropPath                   VARCHAR(255),
    posterPath                     VARCHAR(255),
    trailerLink                    VARCHAR(255),
    tmdbRating                     FLOAT NOT NULL,
    status                         VARCHAR(20) NOT NULL
);

Since becoming host on January 3, 2005, after Craig Kilborn and Tom Snyder, Ferguson has achieved the highest ratings since the show''s inception in 1995. While the majority of the episodes focus on comedy, Ferguson has also addressed difficult subject matter, such as the deaths of his parents, and undertaken serious interviews, such as one with Desmond Tutu, which earned the show a 2009 Peabody Award.', 'https://image.tmdb.org/t/p/original/m0bV3qBiJBBlpFaaKjwHo13MVjm.jpg', 'https://image.tmdb.org/t/p/original/gGC7zSDgG0FY0MbM1pjfhTCWQBI.jpg', NULL, '7.1', 'Ended') ON CONFLICT DO NOTHING;
In most U.S. markets the show airs at 11:35 p.m. Eastern/Pacific time, but is recorded Monday through Wednesday at 4:30 p.m., and Thursdays at 3:30 p.m and 6:00 p.m. The second Thursday episode usually airs on Friday of that week.
In 2002, Late Show with David Letterman was ranked No. 7 on TV Guide''s 50 Greatest TV Shows of All Time. CBS has a contract with Worldwide Pants to continue the show through 2014; by then, Letterman will surpass Johnny Carson as the longest tenured late-night talk show host.', 'https://image.tmdb.org/t/p/original/yogK95l1lK8wyDK9N1YfOiGYJJ8.jpg', 'https://image.tmdb.org/t/p/original/dHjXgLhu7M4Tq6GUbs4m6BZ4HbS.jpg', 'https://www.youtube.com/watch?v=DLSG5xOaqOY', '6.4', 'Ended') ON CONFLICT DO NOTHING;
For its first ten years, Carson''s Tonight Show was based in New York City with occasional trips to Burbank, California; in May 1972, the show moved permanently to Burbank, California.
In 2002, The Tonight Show Starring Johnny Carson was ranked #12 on TV Guide''s 50 Greatest TV Shows of All Time.', 'https://image.tmdb.org/t/p/original/qFfWFwfaEHzDLWLuttWiYq7Poy2.jpg', 'https://image.tmdb.org/t/p/original/oA8QVTGlAN511uCAMDN60aVQUs1.jpg', 'https://www.youtube.com/watch?v=zyl4Vvjc7pI', '7.8', 'Ended') ON CONFLICT DO NOTHING;
The Colbert Report has been nominated for seven Primetime Emmy Awards each in 2006, 2007, 2008, 2009, 2010, 2011, and 2012, two Television Critics Association Awards Awards, and two Satellite Awards. In 2013, it won two Emmys. It has been presented as non-satirical journalism in several instances, including by the Tom DeLay Legal Defense Trust and by Robert Wexler following his interview on the program. The Report received considerable media coverage following its debut on October 17, 2005, for Colbert''s coining of the term "truthiness", which dictionary publisher Merriam-Webster named its 2006 Word of the Year.', 'https://image.tmdb.org/t/p/original/Ajku4m7jbMpCTEPr794Imv19mCA.jpg', 'https://image.tmdb.org/t/p/original/pn2CVXjOlR8kY5MgOTJjZ71IM0Q.jpg', NULL, '6.9', 'Ended') ON CONFLICT DO NOTHING;
Emma Swan is a 28-year-old bail bonds collector who has been supporting herself since she was abandoned as a baby. Things change for her when her son Henry, whom she abandoned years ago, finds her and asks for her help explaining that she is from a different world where she is Snow White''s missing daughter.', 'https://image.tmdb.org/t/p/original/nSJvwZziYaGMbftSDQqQ5GIb47a.jpg', 'https://image.tmdb.org/t/p/original/49qD372jeHUTmdNMGJkjCFZdv9y.jpg', 'https://www.youtube.com/watch?v=Rga4rp4j5TY', '7.3', 'Ended') ON CONFLICT DO NOTHING;
In the show the host surprises a special guest, before taking them through their life with the assistance of the ''big red book''. Both celebrities and non-celebrities have been ''victims'' of the show. The show was originally broadcast live, and over its run it has alternated between being broadcast on the BBC and on ITV.', 'https://image.tmdb.org/t/p/original/yc5zhFNhFi0mhqIeUrkFPDq9kVe.jpg', 'https://image.tmdb.org/t/p/original/zMCF2uU9dleso6iKpFkHfrBxsQ6.jpg', NULL, '6.3', 'Canceled') ON CONFLICT DO NOTHING;
The television show is presently shown on the Encore-Western channel.
Have Gun – Will Travel was created by Sam Rolfe and Herb Meadow and produced by Frank Pierson, Don Ingalls, Robert Sparks, and Julian Claman. There were 225 episodes of the TV series, 24 written by Gene Roddenberry. Other contributors included Bruce Geller, Harry Julian Fink, Don Brinkley and Irving Wallace. Andrew McLaglen directed 101 episodes and 19 were directed by series star Richard Boone.', 'https://image.tmdb.org/t/p/original/xp6Rl3h11IXh4gx6U0yDdpv8Cyg.jpg', 'https://image.tmdb.org/t/p/original/lAL50ghuDgdq3w4MpkrPqMi4yXV.jpg', NULL, '7.5', 'Ended') ON CONFLICT DO NOTHING;
The program featured a wide range of actors, spanning from stars such as Will Ferrell, John C. Reilly, David Cross, Bob Odenkirk, Will Forte and Zach Galifianakis, to alternative comedians like Neil Hamburger, to television actors like Alan Thicke, celebrity look-alikes and impressionists.
The creators of the show have described it as "the nightmare version of television."', 'https://image.tmdb.org/t/p/original/s0tMiK02bA72IS2bGjuvWF9HV2C.jpg', 'https://image.tmdb.org/t/p/original/1dzPN5M6BbT44CTMaXqqkIdhOWK.jpg', 'https://www.youtube.com/watch?v=5Iw1eb-iATs', '7.4', 'Ended') ON CONFLICT DO NOTHING;
Several of the programme''s editors over the years have gone on to senior positions within the BBC and elsewhere. Along with Paxman, the programmes regular presenters are Kirsty Wark, Gavin Esler, and Emily Maitlis.
Newsnight has been broadcast on BBC Two since 1980. It goes out on weekday evenings between 10:30pm and 11:20pm. Occasionally it may have an extended edition if there is an especially significant event in the news - as happened on 7 July 2011, when closure of the News of the World led to an extended programme which continued until 11:35 pm. Recent editions are available to view and download for a limited time through the BBC iPlayer. A weekly 26-minute digest edition of Newsnight is screened on the corporation''s international channel, BBC World News.', 'https://image.tmdb.org/t/p/original/jLCv95JWfEHSIlyMYXoygaRHtxW.jpg', 'https://image.tmdb.org/t/p/original/yU9FJP06oWX2oMTJvpCCdZVRijn.jpg', NULL, '6', 'Returning Series') ON CONFLICT DO NOTHING;
