INSERT INTO media(mediaid, type, name, originallanguage, adult, releasedate, overview, backdroppath, posterpath, trailerlink, tmdbrating, status) VALUES('213', 'True', 'Home and Away', 'en', 'False', '1988-01-17', 'Home and Away is set in the fictional town of Summer Bay, a coastal town in New South Wales, and follows the personal and professional lives of the people living in the area. The show initially focused on the Fletcher family, Pippa and Tom Fletcher and their five foster children Frank Morgan, Carly Morris, Steven Matheson, Lynn Davenport and Sally Keating, who would go on to become one of the show''s longest-running characters. The show also originally and currently focuses on the Stewart family. During the early 2000s, the central storylines focused on the Sutherlands and later, the Hunters. Home and Away had proved popular when it premiered in 1988 and had risen to become a hit in Australia, and after only a few weeks, the show tackled its first major and disturbing storyline, the rape of Carly Morris; it was one of the first shows to feature such storylines during the early timeslot. H&A has tackled many adult-themed and controversial storylines; something rarely found in its restricted timeslot.', 'https://image.tmdb.org/t/p/original/AoKpDxiDcJxcchgSaUvOBpVJHVQ.jpg', 'https://image.tmdb.org/t/p/original/r4E3Mr2uBDUegKmPPaevfdiq8hv.jpg', NULL, '6.3', 'Returning Series') ON CONFLICT DO NOTHING;
